  false,\n\t\"url\": null,\n\t\"notes\": \"The Yellowtail Flounder Tagging Program
  began in 2003 and works with commercial fishermen to tag and release yellowtaiI
  flounder with pink and yellow disc tags or green data storage tags throughout New
  England.  The location, date and various Information is recorded upon the release
  of the tagged fish and the same information is recorded when the fish is recaptured
  by fishermen or other reporters.  From this information stock movements, mortality,
  and growth can be estimated which leads to more accurate biological and stock assessments.n\",\n\t\"owner_org\":
